 Course 2 of the deeplearning.ai TensorFlow Specialization, you will learn advanced techniques to improve the computer vision model you built in Course 1. You will explore how to work with real-world images in different shapes and sizes, visualize the journey of an image through convolutions to understand how a computer “sees” information, plot loss and accuracy, and explore strategies to prevent overfitting, including augmentation and dropout. Finally, Course 2 will introduce you to transfer learning and how learned features can be extracted from models. \n\nThe Machine Learning course and Deep Learning Specialization from Andrew Ng teach the most important and foundational principles of Machine Learning and Deep Learning. This new deeplearning.ai TensorFlow Specialization teaches you how to use TensorFlow to implement those principles so that you can start building and applying scalable models to real-world problems. To develop a deeper understanding of how neural networks work, we recommend that you take the Deep Learning Specialization. \n\nThe full deeplearning.ai TensorFlow Specialization will be available later this year, but you can enroll in the first two courses today. We recommend starting with Course 1: Introduction to TensorFlow for AI, ML, and DL.","id":"5mAuak8zEemKoQ4qeYq26g","photoUrl":"https:\u002F\u002Fd3njjcbhbojbot.cloudfront.net\u002Fapi\u002Futilities\u002Fv1\u002Fimageproxy\u002Fhttps:\u002F\u002Fcoursera-course-photos.s3.amazonaws.com\u002F1e\u002Fb9a22461864399a689eb74c7ae1fc6\u002FTFC2SquareLogo.png","slug":"convolutional-neural-networks-tensorflow","courseType":"v2.ondemand","name":"Convolutional Neural Networks in TensorFlow"}}},"responseCache":{"\u002Fapi\u002FenterpriseAdminRoles.v1?q=byUser&userId=31239514":{"ids":[],"paging":{}},"\u002Fapi\u002FprogramMemberships.v2?q=byUser&userId=31239514":{"ids":[],"paging":{}},"\u002Fapi\u002FopenCourseMemberships.v1?q=findByUserAndSlug&slug=convolutional-neural-networks-tensorflow&userId=3123951
